          function obtenerPorcentaje(data){
            var sumaTotal = 0;
            var progressBar = 0;
            var count = null;
            var long = [];

            for(var value in data){
              var porcentaje = 0;
              if (data[value][0].guia !=null) {porcentaje = porcentaje + 6;}
              if (data[value][0].video !=null) {porcentaje = porcentaje + 4;}
              if (data[value][0].calificacion !==null && data[value][0].calificacion >=80) { porcentaje = porcentaje +10 ;}
              sumaTotal = sumaTotal + porcentaje;
              
            }
            
            for(var mod in data) {
              if( data[mod][0].guia !== null &&  data[mod][0].examen !== null && data[mod][0].calificacion >= 80 && data[mod][0].video !== null) {
                count++;
                long.push(count);
                
              }
              doneConstancy(long);
            }

            $("#porcentaje").html(sumaTotal +"%");
            progressBar = ($(".progress").width() * sumaTotal) / 100;
            $("#porcentaje_bar").css("width", progressBar);
            
            function _getConstancy(result) {
              return result !== 400;
            }
            
            
            function doneConstancy(data) {
              if (data.length === 5) {
                var template = [
                '<div class="callout lead js-constancy" style="background: #202d5c !important;border-color: #25A4D7 !important;color:#ffffff;">',
                  '<h4>¡Tu constancia está lista!</h4>',
                  '<p>Descárgala <a class="js-constancy__link" style="cursor:pointer;font-weight:500;">aquí</a></p>',
                '</div>',
                ];
                $('#progreso').append(template.join(''));
                $('.js-constancy__link').bind('click', generateConstancy);
              }
            }
            
          }

          function getValue(value) {
            if(value === null) {
              return "<i class='fa fa-times' style='font-size: 25px;color: #ff8080;''></i>";
            } else {
              return "<i class='fa fa-check' style='font-size: 25px;color: green;''></i>";
            }
          }
          
          function getValueScore(value) {
            if(value === null) {
              return "<i class='fa fa-times' style='font-size: 25px;color: #ff8080;''></i>";
            }
            if (value >= 80) {
              return "<i class='fa fa-check' style='font-size: 25px;color: green;''></i>";
            }
            else {
              return "<i class='fa fa-times' style='font-size: 25px;color: #ff8080;''></i>";
            }
          }
          
          $.fn.serializeObject = function(){
           var o = {};
           var a = this.serializeArray();
           $.each(a, function() {
             if (o[this.name]) {
              if (!o[this.name].push) {
                o[this.name] = [o[this.name]];
              }
              o[this.name].push(this.value || '');
             }
             else {
                o[this.name] = this.value || '';
             }
           });
           return o;
          };
          
